from typing import List
import numpy as np

class Solution:
    def findSmallestInteger(self, nums: List[int], value: int) -> int:
        
        mod = np.array(nums)%value

        unique, counts = np.unique(mod, return_counts=True)

        count = min(counts)   
        modInt = unique[counts == count][0]
        print(unique[counts == count])

        for i in range(value):
            if i not in unique:
                return i
        
        count = min(counts)   
        modInt = unique[counts == count][0]
        print(unique[counts == count])
        print(count, modInt)        
        return modInt + count*value





